import * as React from 'react'
import Link from 'next/link'
import styled from 'styled-components';

type LayoutProps = {
  title?: string
}

const Layout: React.FunctionComponent<LayoutProps> = ({ children, title }) => (
  <Wrap>
    <header>
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/about">
          <a>About</a>
        </Link>
    </header>
    {children}
  </Wrap>
)

const Wrap = styled.div`

`;

export default Layout;
